import React from "react";

const User3 = () => {
  return (
    <div>
      <div className="display-1"> User Details </div>
      <div className="container display-6">
        <ul>
          <li className="text-primary"> Name : Jhon</li>
          <li className="text-primary"> Account : 83883083981</li>
          <li className="text-primary"> Aadhar : 4030 3033 3303</li>
          <li className="text-primary"> Pan : GK348NOS</li>
        </ul>
      </div>
    </div>
  );
};

export default User3;
